# ====== Compose ====== #


def compose(targets, sources):
    if len(sources) == 1:
        sources = sources * len(targets)
    mean = []
    std = []
    for t, s in zip(targets, sources):
        mean.extend(t[s]["mean"])
        std.extend(t[s]["std"])
    return {"mean": mean, "std": std}


DEFAULT_01 = {"mean": [0.0], "std": [1.0]}


def merge(targets, sources, names):
    stats = {}
    for t, s, n in zip(targets, sources, names):
        if n == "":
            stats["mean"] = t[s]["mean"]
            stats["std"] = t[s]["std"]
        else:
            stats[n + "_mean"] = t[s]["mean"]
            stats[n + "_std"] = t[s]["std"]
    return stats


